import React from 'react';
import { Link } from '@reach/router';

const Header = (props) => {
  return (
    <div>
      <h1>NC-News</h1>
      <nav>
        <Link to="/users">Users</Link>
        <Link to="/hottest">Hottest</Link>
      </nav>
    </div>
  );
};

export default Header;
